    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">4.2&nbsp;</span><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">【信息的发布】</span></strong><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">您声明并保证，您对您所发布的信息拥有相应、合法的权利。否则，</span><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">去干嘛可对您发布的信息依法或依本协议进行删除或屏蔽。</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">4.3【禁止性信息】您应当确保您所发布的信息不包含以下内容：</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>1）违反国家法律法规禁止性规定的；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>2）政治宣传、封建迷信、淫秽、色情、赌博、暴力、恐怖或者教唆犯罪的；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>3）欺诈、虚假、不准确或存在误导性的；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>4）侵犯他人知识产权或涉及第三方商业秘密及其他专有权利的；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>5）侮辱、诽谤、恐吓、涉及他人隐私等侵害他人合法权益的；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>6）存在可能破坏、篡改、删除、影响</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">去干嘛</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">平台任何系统正常运行或未经授权秘密获取平台及其他用户的数据、个人资料的病毒、木马、爬虫等恶意软件、程序代码的；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>7）其他违背社会公共利益或公共道德或依据相关去干嘛平台协议、规则的规定不适合在</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">去干嘛</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">平台上发布的。</span>&nbsp;</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">4.3&nbsp;</span><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">【授权使用】</span></strong><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">您将授权您的微信</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">相关</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">信息允许去干嘛平台使用，通过公众号授权得到您的授权信息。</span>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">4.4【</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">订单内容</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">】您同意</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">通过</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">去干嘛</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">平台上传您要打印的内容，</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">并通过</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">去干嘛合作的第三方</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">打印</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">商户进行打印，</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">对</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">您打印的内容去干嘛不会查看您的任何信息，只有您通过取件码才能在</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">打印商家</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">看到具体打印内容，</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">整个</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">过程去干嘛仅提供文件传输功能，</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">从</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">中</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">如若</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">出现</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">打印</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">内容泄密等问题，</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">去干嘛</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">平台</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">对此</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">概不负责。</span></strong>
    </p>
    <h3 style="margin-top:20px;margin-bottom:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;color: rgb(51, 51, 51);font-size: 20px">五、变更</span></strong>
    </h3>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px"><span style="font-family:PingFang SC">去干嘛可根据国家法律法规变化及维护交易秩序、保护消费者权益需要，不时修改本协议、补充协议，变更后的协议、补充协议（下称</span>“变更事项”）将通过法定程序并以合理方式通知您。</span><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">如您对已生效的变更事项仍不同意的，您应当于变更事项确定的生效之日起停止使用去干嘛平台服务，变更事项对您不产生效力；如您在变更事项生效后仍继续使用</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">去干嘛</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">平台服务，则视为您同意已生效的变更事项。</span></strong>
    </p>
    <h3 style="margin-top:20px;margin-bottom:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;color: rgb(51, 51, 51);font-size: 20px">六、终止</span></strong>
    </h3>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">6.1当您发生以下任一情况时，</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">平台有权限制您的全部或部分权限（包括但不限于下单、参加促销活动等），取消相关未履行完毕的订单、解除合同，或者注销您的</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛账号</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">：</span>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>1）通过网络攻击、大量发布广告等行为影响网站正常经营或影响网站为其他用户提供服务；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>2）多次恶意进行负面评价，违反平台信用评价制度的；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>3）通过不正当手段（如外挂工具、网络攻击、盗刷银行卡等方式）或其他违法、侵犯第三人利益的方式谋取利益；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>4）利用</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">商户</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">过错或失误进行恶意索赔、投诉达两次或以上，或者无故对</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">商户</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">或客服人员进行辱骂、人身攻击；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>5</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">）</span></strong><strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px">服务质量原因，短期内多次拒收商品或拒绝接受服务；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>6）您提供的订单信息（包括但不限于姓名、电话、身份证号、电子邮箱等）不真实、不准确或不完整；</span></strong>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;font-size: 14px"><span style="font-family:PingFang SC">（</span>7）您有其他影响平台正常经营秩序或违法行为。</span></strong>
    </p>
    <h3 style="margin-top:20px;margin-bottom:20px;background:rgb(255,255,255)">
        <strong><span style="font-family: &#39;PingFang SC&#39;;color: rgb(51, 51, 51);font-size: 20px">七、知识产权</span></strong>
    </h3>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">7.1【知识产权保护】您使用</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">平台服务的行为应符合《</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">使用协议》等相关协议关于知识产权的约定。</span>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">7.2【知识产权许可】您在使用</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">平台服务时利用</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛账号</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">发表上传的文字、图片、视频、软件以及表演等原创信息的知识产权归您所有，但是您确认您对该等信息的发表、上传行为视同为对</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">非独占地、永久地、不可撤销地授予该等信息相关全部知识产权的使用、复制等权利，并且您同意</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">可转授权上述权利。</span>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
        <span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">7.3【知识产权归属】除非经过</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">的在先书面同意，您未获得权利使用</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">的任何知识产权。您保证、陈述并承诺您尊重</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">的知识产权。您不会以自己名义或促使第三方，也不会同意或放任任何第三方，为了其任何营销、广告、促销或其他目的，在任何法域、以任何方式申请与</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">或</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">关联公司商标相似的商标、域名、无线网站、互联网搜索词或任何商号、服务标志。如出现上述情况，您须将所有相关权利转让给</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px"><span style="font-family:PingFang SC">，费用由您承担。您保证、陈述并承诺，不会使用以下名称（包括但不限于</span> “</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">”、“</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛儿</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">”、“</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px"><span style="font-family:PingFang SC">呀</span>”、“去打印”、“</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去打印呀</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">”&nbsp;等）作为企业、商户、服务或产品名称的一部分，亦不会使用</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">商标或近似商标的知识产权。如因您违反本条款约定而给</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">去干嘛</span><span style=";font-family:&#39;PingFang SC&#39;;color:rgb(51,51,51);font-size:14px">造成损失的，该损失全部由您承担。</span>
    </p>
    <p style="margin-bottom:10px;text-indent:20px;background:rgb(255,255,255)">
